import React from "react";
import Image from "next/image";

import Layout from "../components/Layout";

const Home = () => {
  return (
    <React.Fragment>
      <Layout>
        <header>
          <Image
            src={"../images/download.jpeg"}
            width={1200}
            height={1000}
            className="title-box"
          />
          <h1 className={"title-text"}>L.H.M</h1>
          {/*</Image>*/}
        </header>
      </Layout>

      <style jsx>{`
        header {
          background: black;
          height: 500px;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .title-box {
          height: calc(100% - 120px);
          width: 70%;
          border: 4px solid white;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .title-text {
          color: white;
          font-size: 6rem;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Home;
